import './App.css';
import Dashboard from './Page/Dashboard';
import {Routes,Route} from 'react-router-dom'
import Main from './Main'

function App() {
  return (
    <div>
    <Main/>

    <Routes>

      <Route exact path='/dashboard' element={<Dashboard/>}/>
    </Routes>

    </div>
  );
}

export default App;
